import axios from 'axios'

function DataFetching() {

    useEffect(() => {
        axios.get('http://jsonplaceholder.typicode.com/posts')
        .then(res => {
            document.write(res.data)
        })
        .catch(error => {
            console.log(error)
        })
    })

    return (
        <div>

        </div>
    )
}

export default DataFetching
